import React from 'react'

export const HeadingTitle = () => {
  return (
    <div style={divStyle}>
        <h2 style={h2Style}>Heading Title</h2>
    </div>
  )
}



const divStyle= {
    backgroundColor:"#fff",
    padding:"10px 30px"
}
const h2Style= {
    color:"#4d5a6e",
    fontSize: "28px",
}
